option objc_class_prefix = "GAPI";



enum LaunchStage {

  LAUNCH_STAGE_UNSPECIFIED = 0;


  UNIMPLEMENTED = 6;


  PRELAUNCH = 7;






  EARLY_ACCESS = 1;










  ALPHA = 2;






  BETA = 3;



  GA = 4;






